<template>
	<view>
		<z-nav-bar backState="1000" color="#fff">
			<view slot="default" class="nav-bar-title">
				推荐觅活
			</view>
		</z-nav-bar>
		<view class="main-container">
			<image class="recommend-container" src="https://www.51mihuo.com/static/images/recommend-mihuo-banner.png"
				mode=""></image>
			<view class="main-title">
				邀请奖励
			</view>
			<!-- <mine-mh-coupon></mine-mh-coupon> -->
			<view class="invitation-container flex-center">
				<view class="left flex-center">
					邀请码
					<view class="code">
						{{ inviteCode }}
					</view>
				</view>
				<view class="right" @click="copyCode">
					复制邀请码
				</view>
			</view>
			<!-- #ifndef MP-WEIXIN -->
			<view class="send-button" @click="getQrCode">
				发送邀请海报
			</view>
			<!-- #endif -->
			<view class="main-title">
				推荐统计
			</view>
			<view class="counter-container flex-center">
				<view class="counter-item flex-center">
					<view class="count-number">
						{{ statsData.shareCount || 0 }}<text class="small-text">次</text>
					</view>
					<view class="count-name">
						推荐次数
					</view>
				</view>
				<view class="counter-item flex-center">
					<view class="count-number">
						{{ statsData.registerCount || 0 }}<text class="small-text">次</text>
					</view>
					<view class="count-name">
						注册用户数
					</view>
				</view>
				<view class="counter-item flex-center">
					<view class="count-number">
						{{ statsData.orderCount || 0 }}<text class="small-text">次</text>
					</view>
					<view class="count-name">
						下单数
					</view>
				</view>
				<view class="counter-item flex-center">
					<view class="count-number">
						{{ statsData.rewardsCount || 0 }}<text class="small-text">次</text>
					</view>
					<view class="count-name">
						已获得奖励
					</view>
				</view>
			</view>
			<image class="detail-container" src="https://www.51mihuo.com/static/images/recommend-mihuo.png">
			</image>
		</view>
		<uni-popup ref="posterPopup" type="center" :maskClick="true">
			<view class="poster-container flex-center">
				<view id="poster-image" class="poster">
					<img :src="imgBase64" class="poster-image"></img>
					<img class="qr-code" :src="wxCode"></img>
				</view>
				<view class="bottom-container">
					<view class="items flex-center">
						<!-- #ifdef APP-PLUS -->
						<!-- <view class="icon-item flex-center">
							<image class="icon" src="https://www.51mihuo.com/static/images/wechat_friend.png"></image>
							<view class="text">
								微信好友
							</view>
						</view>
						<view class="icon-item flex-center">
							<image class="icon" src="https://www.51mihuo.com/static/images/pyq.png"></image>
							<view class="text">
								朋友圈
							</view>
						</view> -->
						<view class="icon-item flex-center" @click="canvasImage.generateImage">
							<image class="icon" src="https://www.51mihuo.com/static/images/save_image.png"></image>
							<view class="text">
								保存图片
							</view>
						</view>
						<!-- #endif -->
					</view>
					<view class="bottom-button" @click="closePopup">
						取消
					</view>
				</view>
			</view>
		</uni-popup>
	</view>
</template>

<script lang="renderjs" module="canvasImage">
	import html2canvas from 'html2canvas'
	export default {
		methods: {
			generateImage(e, ownerFun) {
				const dom = document.getElementById('poster-image') // 需要生成图片内容的 dom 节点
				html2canvas(dom, {
					width: dom.clientWidth, // dom 原始宽度
					height: dom.clientHeight,
					scrollY: 0, // html2canvas默认绘制视图内的页面，需要把scrollY，scrollX设置为0
					scrollX: 0,
					useCORS: true, // 支持跨域
					scale: 2, // 设置生成图片的像素比例，默认是1，如果生成的图片模糊的话可以开启该配置项
				}).then((canvas) => {
					// html2canvas 生成成功的图片链接需要转成 base64位的url
					ownerFun.callMethod('receiveRenderData', canvas.toDataURL('image/png'))
				}).catch(err => {
					console.log(err)
				})
			}
		}
	}
</script>

<script>
	import {
		pathToBase64,
		base64ToPath
	} from '../../js_sdk/mmmm-image-tools/index.js'
	import baseConfig from '@/config/common.js'
	const currentMode = uni.getStorageSync('devModeApi')
	let common = baseConfig
	if (currentMode) {
		common = currentMode
	}
	export default {
		data() {
			return {
				imgBase64: 'data:image/png;base64,',
				inviteCode: '',
				statsData: {},
				wxCodeData: '',
				wxCode: '',
				localPath: ''
			}
		},
		onShareAppMessage() {
			return {
				title: '自定义分享标题',
				path: '/pages/home-home',
				imageUrl: this.localPath
			}
		},
		onLoad() {
			this.getData()
			this.getUserInfo()
		},
		onShareAppMessage(){
			const coverImg = 'https://www.51mihuo.com/static/images/mihuo-share.JPG'
			const path = `/pages/home/home?isFromShare=1`
			const result = this.$util.shareToWechat(
				'装修更透明，施工更标准，省钱更省心！',
				coverImg,
				path,
				'推荐觅活',
				true,
				1
			)
			return result
		},
		methods: {
			async receiveRenderData(val) {
				const path = await base64ToPath(val)
				if (path) {
					this.localPath = path
					this.saveImage(path)
				}
			},
			// 保存图片到本地
			saveImage(filePath) {
				// #ifdef APP-PLUS
				uni.saveImageToPhotosAlbum({
					filePath,
					success: () => {
						this.$util.toast('保存成功')
						this.closePopup()
					},
					fail: () => {}
				})
				// #endif
			},
			// 点击发送邀请海报
			getQrCode() {
				uni.showLoading()
				const userData = uni.getStorageSync('userData')
				let userId, invitationCode
				if (userData) {
					userId = userData.sysUser.userId
					invitationCode = userData.sysUser.inviteCode
				}
				const url = 'pages/home/home'
				// scene 最大长度32
				const scene = `userId=${userId}&iCode=${invitationCode}`
				this.$httpApi.getWxMaQrcode({
					clientId: 'cmini', // 觅活应用Id
					page: url, // 页面page
					scene: scene,
					envVersion: common.envVersion,
					type: 'MINI' // 账号类型
				}).then(res => {
					if (res) {
						this.wxCodeData = 'data:image/png;base64,' + res
						this.wxCode = this.wxCodeData
						this.$refs.posterPopup.open()
					}
				}).finally(res => {
					uni.hideLoading()
				})
			},
			closePopup() {
				this.$refs.posterPopup.close()
			},
			copyCode() {
				this.$tools.copy(this.inviteCode)
			},
			// 获取用户推荐统计信息
			getData() {
				this.$httpApi.getUserRecommendStats().then(res => {
					this.statsData = res
				})
			},
			// 获取用户信息
			getUserInfo() {
				this.$httpApi.getPersonInfo().then(res => {
					this.inviteCode = res.sysUser.inviteCode
				})
			}
		}
	}
</script>

